      INSERT INTO characters(id,name,description,modified,thumbnail,marvelURI,comics,series,stories,events,urls) VALUES (1017110,'Falcon/Sam Wilson (MAA)','Recruited from S.H.I.E.L.D. by his hero and mentor Tony Stark, Falcon is the Avengers'' newest and youngest recruit. Like Tony, Sam is a genius with machines and technology. What he lacks in experience, Sam makes up in enthusiasm and determination. Falcon''s suit of armor comes fully stocked with holographic wings, explosive flechettes, and retractable talons.','2013-09-18T15:52:17-0400','http://i.annihil.us/u/prod/marvel/i/mg/3/10/523219c347dd1/jpg','http://gateway.marvel.com/v1/public/characters/1017110','""','""','""','""','"http://marvel.com/comics/characters/1017110/falconsam_wilson_maa?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/comics/characters/1017110/falconsam_wilson_maa?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979"');
