      INSERT INTO characters(id,name,description,modified,thumbnail,marvelURI,comics,series,stories,events,urls) VALUES (1009664,'Thor','As the Norse God of thunder and lightning, Thor wields one of the greatest weapons ever made, the enchanted hammer Mjolnir. While others have described Thor as an over-muscled, oafish imbecile, he''s quite smart and compassionate.  He''s self-assured, and he would never, ever stop fighting for a worthwhile cause.','2016-06-22T12:53:06-0400','http://i.annihil.us/u/prod/marvel/i/mg/d/d0/5269657a74350/jpg','http://gateway.marvel.com/v1/public/characters/1009664','"43506, 30090, 46852, 12637, 12725, 12668, 43170, 43171, 6748, 277, 5808, 16904, 16890, 1262, 39896, 32769, 33652, 32771, 32774, 32776"','"16450, 9790, 2116, 17650, 454, 2984, 318, 14779, 9858, 744, 3621, 22547, 354, 9085, 1991, 24229, 9859, 9086, 1988, 13320"','"876, 877, 879, 880, 881, 882, 883, 884, 885, 886, 887, 888, 889, 890, 891, 892, 893, 894, 895, 896"','"116, 233, 234, 310, 235, 296, 238, 318, 246, 302, 252, 315, 29, 37, 263, 154, 336, 269, 270, 271"','"http://marvel.com/characters/1009664/thor/featured?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/universe/Thor_(Thor_Odinson)?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/comics/characters/1009664/thor?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979"');
      INSERT INTO characters(id,name,description,modified,thumbnail,marvelURI,comics,series,stories,events,urls) VALUES (1017576,'Thor (Goddess of Thunder)','<p class="Body">When the Odinson lost his ability to wield Mjolnir, the role of Thor, God of Thunder, was left unoccupied&hellip;albeit for a short time. A mysterious female figure picked up the hammer with ease, changing the inscription to fit her status as the Goddess of Thunder.</p>','2014-11-17T17:48:24-0500','http://i.annihil.us/u/prod/marvel/i/mg/4/10/545a857a38f92/jpg','http://gateway.marvel.com/v1/public/characters/1017576','"55363, 55364, 55365, 55368, 60532, 61373, 61380, 61381, 61383, 64791, 62110, 61456, 58678, 60968, 62136, 65119, 63967, 66775, 66776, 64417"','"22374, 20443, 22547, 23601, 22738, 22552, 21419, 20457, 22763, 23684, 23282, 24156, 24157, 23456, 20527, 20529, 22121, 22811, 22810, 22812"','"117163, 121769, 121771, 121773, 121779, 122621, 122633, 122635, 122637, 122639, 122641, 122643, 122645, 122647, 122649, 123139, 127942, 130841, 131439, 131533"','"337, 333, 336"','"http://marvel.com/characters/1017576/thor_goddess_of_thunder/featured?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/comics/characters/1017576/thor_goddess_of_thunder?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979"');
      INSERT INTO characters(id,name,description,modified,thumbnail,marvelURI,comics,series,stories,events,urls) VALUES (1017106,'Thor (MAA)','Thor is the Asgardian Prince of Thunder, the son of Odin, and the realm''s mightiest warrior. He loves the thrill of battle and is always eager to show off his power to the other Avengers, especially the Hulk. Thor''s legendary Uru hammer, Mjolnir, gives him the power to control thunder and the ability to fly. He''s found a new home on Earth and will defend it as his own... even if he doesn''t understand its sayings and customs.','2013-09-18T15:49:30-0400','http://i.annihil.us/u/prod/marvel/i/mg/2/03/52321948a51f2/jpg','http://gateway.marvel.com/v1/public/characters/1017106','""','""','""','""','"http://marvel.com/comics/characters/1017106/thor_maa?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/comics/characters/1017106/thor_maa?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979"');
