      INSERT INTO characters(id,name,description,modified,thumbnail,marvelURI,comics,series,stories,events,urls) VALUES (1010360,'Thunderbolts','After a battle with Onslaught left the world without the majority of the heroes that made it feel safe, Baron Zemo devised a plan like no other in order to rule the world. Zemo gathered Beetle, Fixer, Goliath, Moonstone, and Screaming Mimi, all former members of the Masters of Evil, together to disguise themselves as a new heroic team in order to take advantage of the missing heroes and gain the trust of the authorities and public in general.','2013-01-22T14:10:08-0500','http://i.annihil.us/u/prod/marvel/i/mg/b/a0/50fec50a26dc1/jpg','http://gateway.marvel.com/v1/public/characters/1010360','"6859, 21931, 29218, 29219, 4461, 401, 442, 493, 678, 736, 547, 26197, 6135, 40775, 40771, 40776, 40780, 40773, 40774, 40778"','"454, 9086, 1737, 715, 8213, 1885, 789, 7690, 8456, 23970, 20084, 4889, 23793, 947, 987, 788, 1514, 1547, 2504, 6796"','"2845, 2847, 2849, 2851, 2853, 2855, 3886, 3892, 3902, 3904, 3905, 3906, 3907, 3908, 3909, 3910, 3911, 3912, 3913, 3914"','"238, 318, 302, 255, 37, 336, 269, 59, 273"','"http://marvel.com/comics/characters/1010360/thunderbolts?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/universe/Thunderbolts?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/comics/characters/1010360/thunderbolts?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979"');
