      INSERT INTO characters(id,name,description,modified,thumbnail,marvelURI,comics,series,stories,events,urls) VALUES (1011316,'Vapor','Vapor, along with her brother, was among the small group led by Simon Utrecht to simulate the crash that gave the Fantastic Four their powers, and has remained with the U-Foes ever since.','1969-12-31T19:00:00-0500','http://i.annihil.us/u/prod/marvel/i/mg/3/40/4c002e541867f/jpg','http://gateway.marvel.com/v1/public/characters/1011316','""','""','""','""','"http://marvel.com/comics/characters/1011316/vapor?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/universe/Vapor?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/comics/characters/1011316/vapor?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979"');
