      INSERT INTO characters(id,name,description,modified,thumbnail,marvelURI,comics,series,stories,events,urls) VALUES (1011128,'Venom (Ultimate)','While Eddie Brock’s academic career seemed to take off, his personal life was in shambles due to his quick temper and inability to connect with women on any level, and Eddie became isolated, but when his old friend Peter Parker contacted him, he felt a rush of enthusiasm: here, at last, was someone with whom he could truly bond.','2014-03-05T13:58:42-0500','http://i.annihil.us/u/prod/marvel/i/mg/e/10/531773a976816/jpg','http://gateway.marvel.com/v1/public/characters/1011128','"46915, 14846, 6181, 1012, 17378, 17377, 26923, 24316"','"13831, 466, 1919, 74, 3188, 7515"','"30327, 36428, 36430, 36431, 59157, 59158, 141180"','""','"http://marvel.com/characters/1011128/venom_ultimate/featured?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/universe/Venom_(Ultimate)?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979, http://marvel.com/comics/characters/1011128/venom_ultimate?utm_campaign=apiRef&utm_source=1443b4394b5bac522065c14a277f7979"');
